import React, { Component } from 'react';
import countries from '../helpers/countries';

export default class SearchFilterCountry extends Component {

  render() {

    const items = countries.filter((data)=>{
      if(this.state.search == null)
          return data
      else if(data.name.toLowerCase().includes(this.state.search.toLowerCase())){
          return data
      }
    }).map(data=>{
      return(
      <div >
        <ul >
          <li>
            <span style={styleInfo}>{data.name}</span>
          </li>
        </ul>
      </div>
      )
    })

    return (
      <div>
          <input onChange={(e) => console.log(e.target.value)} type='text' />
          <ul>
            {countries.map( item => <li>{item.name}</li>) }
          </ul> 
      </div>
    )
  }
}
